import React from 'react';
import { Button } from 'antd';
import { useNavigate } from "react-router-dom";
class Login extends React.Component {
    heandlogin = () => {
        useNavigate('/Home');
    }
    render() {
        return (
            <div>
                <p>登录页面</p>
                <Button type="primary" onClick={this.heandlogin}>登录</Button>
            </div>
        )
    }
}

export default Login;
